var GETDOM = (function(){
   var AJAX_ = 0;
   var ajax_ = function(obj) {
        obj = obj || {};
        obj.type = (obj.type || 'GET').toUpperCase();
        obj.dataType = obj.dataType || 'json';
        obj.timeout = obj.timeout || 10000;
        var xhrTimeout;//前端超时放弃请求，默认10秒
        var params = formatParams(obj.data); //参数格式化
        var getNowFormatDate = function() {
            var date = new Date();
            var seperator1 = "-";
            var seperator2 = ":";
            var month = date.getMonth() + 1;
            var strDate = date.getDate();
            if (month >= 1 && month <= 9) {
                month = "0" + month;
            }
            if (strDate >= 0 && strDate <= 9) {
                strDate = "0" + strDate;
            }
            var currentdate = date.getFullYear() + seperator1 + month + seperator1 + strDate
                    + " " + date.getHours() + seperator2 + date.getMinutes()
                    + seperator2 + date.getSeconds();
            return currentdate;
        }
        //step1:兼容性创建对象
        if (window.XMLHttpRequest) {
            var xhr = new XMLHttpRequest();
        } else {
            var xhr = new ActiveXObject('Microsoft.XMLHTTP');
        }
        if(AJAX_ == 0){
          myApp.showIndicator();
        }
        AJAX_++;
        xhr.onreadystatechange = function() {
            if (xhr.readyState == 4) {
                 AJAX_--;
                if(AJAX_== 0){
                  myApp.hideIndicator();
                }                
                try{
                    if (xhr.status >= 200 && xhr.status < 300) {
                        obj.success && obj.success(xhr.responseText, xhr.responseXML);
                    } else {
                        obj.error && obj.error(xhr.status);
                    }                     
                }catch(e){}                

            }
        }
        //step2 step3:连接 和 发送
        if (obj.type == 'GET') {
            xhr.open('GET', obj.url + '?' + params, true);
            xhr.send(null);
        } else if (obj.type == 'POST') {
            xhr.open('POST', obj.url, true);
            //设置请求头，以表单形式提交数据
            xhr.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');

            xhr.send(params);
        }
         xhr.timeout = obj.timeout;
         xhr.ontimeout = function(){
            alert('请求超时，请稍后再试！');
         }
       
        //辅助函数，格式化参数

        function formatParams(data) {
            var arr = [];
            for (var name in data) {
                arr.push(encodeURIComponent(name) + "=" + encodeURIComponent(data[name]));
            }
            //设置随机数，防止缓存
            arr.push("t=" + Math.random());
            return arr.join("&");
        }
    }   
   return {
     _id:function(el){
        return document.querySelector(el)
     },
     _class:function(el){
        return document.querySelectorAll(el)
     },

	/*ajax使用方式：
	 * URL:请求地址(String)
	 * DATA:报文裸入参(Object)
	 * fn1:成功回调函数
	 * fn2:失败回调函数
	 * 使用方式：ajax(URL, DATA, function(data) {}, function(data) {})
	 * */
     
     _ajax:function(url, obj, success, error){
		      ajax_({
		        url: url,
		        type: "POST",
		        dataType: "json",
		        data:obj,
		        success: function(data, b) {
		            // console.log('返回报文:'+data)
		            try{
		                var data_ = JSON.parse(data);
		            }
		            catch(e){
		                
		                
		            }
		            success(data_);

		        },
		        error: function(status) {
		            error(status);
		        }
		    })
    }
   }
}());

